function App() {
  return (
    <div className="App">
      <header className="App-header">
        <img src={logo} className="App-logo" alt="logo" />
        <p>
          Edit derp derp <code>src/App.js</code> and save to reload.
        </p>
        <Link to="/LoginPage">Login Page</Link>
      </header>
    </div>
  );
}

export default App;
